import React from 'react'
import { Navigate, Route } from 'react-router-dom';

export default function PrivateRoute({ element: Element, isAuthenticated, ...rest }) {
    return (
        <Route
        {...rest}
        render={({ location }) =>
          isAuthenticated ? (
            <Element />
          ) : (
            <Navigate
              to={{
                pathname: '/login',
                state: { from: location }
              }}
            />
          )
        }
      />
    )
}
